import React from 'react'
import "./AddNewCar.css";

const AddNewCar = () => {
  const fuelOptions = ["petrol", "diesel", "electric", "gas", "other"];
  const years = [];
  const doors = [];

  for (let i = 1975; i <= 2022; i++) {
    years.push(i);
}

for (let y = 2; y <= 5; y++) {
  doors.push(y);
}

  return (
    <div className='add-car-form-container'>
        <div class="main">  	
		<input type="checkbox" id="chk" aria-hidden="true" />

			<div class="add-car">
				<form>
					<label for="chk" aria-hidden="true">Add new car</label>
					<input 
                    type="text" 
                    name="brand" 
                    placeholder="Brand" 
                    required='' 
                    className="input" 
                    // onChange={({ target }) =>
                    // setCredentialsRegister({ ...credentialsRegister, first_name: target.value })
                    // }
                    />
                    <input 
                    type="text" 
                    name="model" 
                    placeholder="Model" 
                    required='' 
                    className="input" 
                    // onChange={({ target }) =>
                    // setCredentialsRegister({ ...credentialsRegister, last_name: target.value })
                    // }
                    />
                    <span className='input-label'>Year: </span>
                    <select
                    className="input" 
                    name='production_year'
                    // value={newCar.year}
                    // onChange={({ target }) =>
                    // setCredentialsRegister({ ...credentialsRegister, last_name: target.value })
                    // }
                    >
                      {
                        years.map((year,index) => (
                          <option key={index} value={year}>{year}</option>
                        ))
                      }
                    </select>
                    <input 
                    type="text" 
                    name="country_of_origin" 
                    placeholder="Country of origin" 
                    required='' 
                    className="input" 
                    // onChange={({ target }) =>
                    // setCredentialsRegister({ ...credentialsRegister, last_name: target.value })
                    // }
                    />
                    <span className='input-label'>Fuel: </span>
                    <select
                    className="input" 
                    name='fuel'
                    // value={newCar.fuel}
                    // onChange={({ target }) =>
                    // setCredentialsRegister({ ...credentialsRegister, last_name: target.value })
                    // }
                    >
                      {
                        fuelOptions.map((option,index) => (
                          <option key={index} value={option}>{option}</option>
                        ))
                      }
                    </select>
                    <input 
                    type="text" 
                    name="engine" 
                    placeholder="Engine name" 
                    required='' 
                    className="input" 
                    // onChange={({ target }) =>
                    // setCredentialsRegister({ ...credentialsRegister, last_name: target.value })
                    // }
                    />
                    <span className='input-label'>Doors: </span>
                    <select
                    className="input" 
                    name='door'
                    // value={newCar.doors}
                    // value={newCar.fuel}
                    // onChange={({ target }) =>
                    // setCredentialsRegister({ ...credentialsRegister, last_name: target.value })
                    // }
                    >
                      {
                        doors.map((door,index) => (
                          <option key={index} value={door}>{door}</option>
                        ))
                      }
                    </select>
					<button className='btn--add'>Add</button>
				</form>
			</div>
	</div>
    </div>
  )
}

export default AddNewCar
